import React, { Component } from "react";

class Card extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isViewable: false,
    };
  }

  handleClick(evt){
      alert("CLicked")
  }
  render() {
    return (
      <div>
        <h1>Card Number: {this.props.cardInfo.lNum}</h1>
        <h1>Exp Date: {this.props.cardInfo.expDate}</h1>
        <h1>CVC: {this.props.cardInfo.cvc}</h1>
        <h1>Last 4: {this.props.cardInfo.last4}</h1>

        <i class="far fa-eye" onClick={this.handClick}></i>


      </div>
    );
  }
}

export default Card;
